const key = process.env.youtube_api_key
const baseUrl = 'https://www.googleapis.com/youtube/v3'
const searchUrl = baseUrl
  + '/search'
  + '?part=snippet'
  + '&eventType=live'
  + '&type=video'
  + `&key=${key}`
  + '&maxResults=50'


const videosUrl = baseUrl
  + '/videos'
  + '?part=liveStreamingDetails'
  + `&key=${key}`

const channelsUrl = baseUrl
  + '/channels'
  + '?part=snippet'
  + `&key=${key}`

let streams = []
export default async function getStreams() {
  let result
  if (process.env.PORT) {
    let response = await get(searchUrl)
    result = response.data.items

    const videoIds = result.map(stream => stream.id.videoId).join()
    response = await get(`${videosUrl}&id=${videoIds}`)
    response.data.items.forEach(({id, liveStreamingDetails}) => {
      const stream = result.find(stream => stream.id.videoId === id)
      stream.liveStreamingDetails = liveStreamingDetails
    })

    const channelIds = result.map(stream => stream.snippet.channelId).join()
    response = await get(`${channelsUrl}&id=${channelIds}`)
    response.data.items.forEach(({id, snippet}) => {
      const stream = result.find(stream => stream.snippet.channelId === id)
      stream.channel = snippet
    })
  } else {
    result = localhostData
  }

  streams = result
    .filter(s => s.channel)
    .map(({liveStreamingDetails, snippet, channel}) => ({
    source: 'youtube',
    name: snippet.channelTitle,
    viewers: liveStreamingDetails.concurrentViewers,
    avatar: channel.thumbnails.default.url,
  }))
  return streams
}
